public class ArithmeticOperation_23 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a = 4;
        a -= 10;
        a = -a;
        a = 7 + a;
        System.out.println(" a = " + a );
        a %= a;
        a = a * a - 3 ;
        System.out.println(" a = " + a );
	}

}
